import { Route, Routes } from 'react-router-dom';
import './App.css';
import Header from './Components/Header';
import Footer from './Components/Footer';
import Admin from './Components/Admin';

function App() {
  return (
    <div className="App">
     <Header/>
     <Routes>
      <Route path='/' element={<Admin/>}/>
      <Route path='/add' element/>
     </Routes>
     <Footer/>

    </div>
  );
}

export default App;
